<script>
	export default {
		data() {
			return {
				text:"",
				infoImage:"",
				loginName:true,
				flng:false
			}
		},
		onShow() {
			//取除本地缓存数据
			this.getStoryData();
			
		},
		methods: {
			//跳转到登录页面
			onlogin(){
				uni.navigateTo({
					url:"../login/login"
				})
			}
			,
			//取除本地缓存数据
			getStoryData(){
				let userInfo = uni.getStorageSync('userInfo');
				//console.log(userInfo)
				if(userInfo){
					this.text = userInfo.nickName
					this.infoImage = userInfo.avUrl
					this.loginName = false
					this.flng =false
 				}else {
					this.text = "游客"
					this.infoImage = require('../../static/images/my/unlogin_head.png')
					
					this.loginName = true
					
					this.flng =true
				}
			},
			//用户退出
			Outlogin(){
				uni.showModal({
				    title: '',
				    content: '确定要注销吗?',
				    success:  (res) =>{
				        if (res.confirm) {
				           uni.removeStorageSync('userInfo');
						   //取除本地缓存数据
						   this.getStoryData();
						   
						   this.flng =true
						   
				        } else if (res.cancel) {
				            console.log('用户点击取消');
				        }
				    }
				});
			}
		}
	}
</script>

